CREATE TABLE IF NOT EXISTS t_data_episode (
  id_episode int(6) NOT NULL,
  id_serie int(5) NOT NULL,
  Combined_episodenumber float(8,4) DEFAULT NULL,
  Combined_season int(1) DEFAULT NULL,
  DVD_chapter varchar(0) COLLATE utf8_unicode_ci DEFAULT NULL,
  DVD_discid varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  DVD_episodenumber varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  DVD_season varchar(1) COLLATE utf8_unicode_ci DEFAULT NULL,
  Director varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  EpImgFlag int(1) DEFAULT NULL,
  EpisodeName varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  EpisodeNumber int(1) DEFAULT NULL,
  FirstAired varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  GuestStars varchar(400) COLLATE utf8_unicode_ci DEFAULT NULL,
  IMDB_ID varchar(9) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Language` varchar(2) COLLATE utf8_unicode_ci DEFAULT NULL,
  Overview varchar(2000) COLLATE utf8_unicode_ci DEFAULT NULL,
  ProductionCode varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  Rating float(3,2) DEFAULT NULL,
  RatingCount int(1) DEFAULT NULL,
  SeasonNumber int(1) DEFAULT NULL,
  Writer varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  absolute_number varchar(40) COLLATE utf8_unicode_ci DEFAULT NULL,
  airsafter_season varchar(40) COLLATE utf8_unicode_ci DEFAULT NULL,
  airsbefore_episode int(1) DEFAULT NULL,
  airsbefore_season int(1) DEFAULT NULL,
  filename varchar(300) COLLATE utf8_unicode_ci DEFAULT NULL,
  lastupdated int(10) DEFAULT NULL,
  seasonid int(5) DEFAULT NULL,
  PRIMARY KEY (id_episode,id_serie)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS t_data_serie (
  id_serie int(10) NOT NULL,
  Airs_DayOfWeek varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  Airs_Time varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  ContentRating varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  FirstAired datetime DEFAULT NULL,
  IMDB_ID varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  Network varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  NetworkID varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  Rating float(5,2) DEFAULT NULL,
  RatingCount int(5) DEFAULT NULL,
  Runtime int(4) DEFAULT NULL,
  SeriesID int(10) DEFAULT NULL,
  `Status` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  added varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  addedBy varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  banner varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  fanart varchar(40) COLLATE utf8_unicode_ci DEFAULT NULL,
  lastupdated int(10) DEFAULT NULL,
  poster varchar(40) COLLATE utf8_unicode_ci DEFAULT NULL,
  zap2it_id varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  dt_last_update datetime DEFAULT NULL,
  PRIMARY KEY (id_serie)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS t_data_serie_acteur (
  id int(10) NOT NULL,
  Actors varchar(60) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (id,Actors)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS t_data_serie_lang (
  id_serie int(10) NOT NULL,
  `Language` varchar(2) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  Overview varchar(3000) COLLATE utf8_unicode_ci DEFAULT NULL,
  SeriesName varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (id_serie,`Language`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS t_ref_language (
  `name` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  abbreviation varchar(2) COLLATE utf8_unicode_ci DEFAULT NULL,
  id int(2) NOT NULL DEFAULT '0',
  PRIMARY KEY (id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


