INSERT INTO t_data_serie_lang (id_serie, `Language`, Overview, SeriesName) VALUES(72218, 'en', 'Smallville revolves around Clark Kent (Tom Welling) and his burgeoning career at the Daily Planet alongside his future love, Lois Lane (Erica Durance). He''s supported by his friends, Chloe Sullivan (Allison Mack) and Oliver Queen (aka Green Arrow) (Justin Hartley) as they deal with Lex Luthor''s replacement, Tess Mercer (Cassidy Freeman), who initially unleashed a new world of danger in alliance with Major Zod (Callum Blue), a survivor of the doomed planet of Krypton, but has since become a sometimes ally of Clark''s.', 'Smallville');
INSERT INTO t_data_serie_lang (id_serie, `Language`, Overview, SeriesName) VALUES(72218, 'fr', 'Dans une petite bourgade qui a connu une pluie de mÃ©tÃ©orites quelques annÃ©es plus tÃ´t, le jeune Clark Kent est Ã©levÃ© par une famille de fermiers. Contraint de cacher ses pouvoirs exceptionnels, il va apprendre Ã  les utiliser pour aller au secours de son prochain.', 'Smallville');
INSERT INTO t_data_serie_lang (id_serie, `Language`, Overview, SeriesName) VALUES(76290, 'en', '"24" is a TV thriller presented in "real time" with each minute of airtime that corresponds to a minute in the lives of the characters. "24" employs fast-paced and complex stories, and often contains unexpected plot twists. Though each day''s events typically revolve around thwarting an impending terrorist attack, each season is made up of various interwoven story threads. These may run for just one hour, but more usually run over several hours. These typically involve investigations of leads on terrorists, tracking suspects, and averting attacks. The exact objective of the day evolves over the course of the season as the antagonists adapt, contingencies arise, and larger scale operations unfold.', '24');
INSERT INTO t_data_serie_lang (id_serie, `Language`, Overview, SeriesName) VALUES(76290, 'fr', 'Agent fédéral et responsable de la Cellule Anti-Terroriste de Los Angeles, Jack Bauer a 24 heures pour mener à bien sa mission, empêcher que des terroristes ne mettent leur plan à exécution, protéger les siens du danger qui les menacent, et sauver l’Amérique au besoin … Chaque saison correspond à 24 heures dans la vie de Jack Bauer en temps réel.', '24 Heures Chrono');
INSERT INTO t_data_serie_lang (id_serie, `Language`, Overview, SeriesName) VALUES(78901, 'fr', 'La mère de Dean et de Sam est tuée lors d''une terrible soirée. Leur père est persuadé que c''est l''oeuvre des forces du mal. Vingt ans plus tard, Sam est à l''université. Alors qu''il mène une vie rangée et paisible, Dean vient le voir et lui demander de l''aider à rechercher leur père qui a disparu: Sam va alors accepter. Un message téléphonique mystérieux de leur père mène les frères Winchester vers un village de Californie marqué par une série de décès inexpliqués. Ils sont rapidement confrontés à la légende locale de la « Dame en blanc », une jolie autostoppeuse qui erre sur les chemins de campagne le soir, conduisant les jeunes hommes à leur perte. Bien qu''ils ne trouvent pas leur père, Dean et Sam découvrent son journal et tentent de déchiffrer ses notes afin de trouver des indices qui les aideront à détruire le spectre. Une fois le boulot terminé, Sam retourne à l''université mais découvre que la force maléfique qui avait réclamé sa mère, a maintenant pris sa petite amie de la même façon. Pris de rage, de tristesse et de culpabilité, Sam comprend soudainement l''obsession de son père. À l''instar de Dean, Sam est maintenant complètement dédié à la quête de réponses, et, ultimement, à prendre sa revanche.', 'Supernatural');
INSERT INTO t_data_serie_lang (id_serie, `Language`, Overview, SeriesName) VALUES(79432, 'fr', 'When science fiction becomes science fact.\nThis groundbreaking series unravels the extra-sensory feats and near-paranormal powers of animals. It journeys to the outer limits of scientific knowledge to find a parallel animal universe where life exists in other realities and has powers that almost defy belief. Here sharks perceive human electric auras and dolphins use ultrasound to ''see'' a human foetus in the womb. There are monkey herbalists, frogs that have mastered the art of cryogenics and lizards that walk on water or cry blood. \n\nSupernatural not only looks at animal hypnosis and the healing powers of fish and dolphins, it even explains weird phenomena such as animals foretelling earthquakes or forecasting the weather and fish that ''rain'' from the sky.', 'Supernatural The Unseen Powers of Animals');
